import EmpolyerItem from "./EmpolyerItem.js";


const Empolyer = () => {
    return(
        <div className="empolyer">
            <EmpolyerItem 
                name='NOUR' 
                nick='HOMSI' 
                role='web developer' 
                img='https://picsum.photos/id/60/200/300' 
                alt='pic-empolyee-1'/>
            <EmpolyerItem name='NADHIR' nick='NACEF' role='designer' img='https://picsum.photos/id/61/200/300' alt='pic-empolyee-2'/>
            <EmpolyerItem name='RAOUF' nick='ALIM' role='mobile developer' img='https://picsum.photos/id/62/200/300' alt='pic-empolyee-3'/>
            <EmpolyerItem name='MEHDI' nick='SLIMANI' role='desktop developer' img='https://picsum.photos/id/63/200/300' alt='pic-empolyee-4'/>
        </div>
    )
}
export default Empolyer
